{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/liamguyton/capstone-bellabeat-case-study-in-r?scriptVersionId=109840832\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"803dd285","metadata":{"papermill":{"duration":0.010498,"end_time":"2022-11-02T13:56:55.483254","exception":false,"start_time":"2022-11-02T13:56:55.472756","status":"completed"},"tags":[]},"source":["# **<span style=\"color:#005e6a\"> Capstone - Bellabeat Case Study in R </span>**\n","\n","<center><img src=\"https://i.imgur.com/wFpooB9.png\"></center>\n","\n","# <span style=\"color:#005e6a\"> Table of Contents </span>\n","\n","* [1. Introduction](#introduction_1)\n","* [2. About the Company](#about_company_2)\n","* [3. Ask](#ask_3)\n","    * [3.1 Business Task](#business_task_3_1)\n","    * [3.2 Key Stakeholders](#key_stakeholders_3_2)\n","* [4. Prepare](#prepare_4)\n","    * [4.1 About the Data](#about_data_4_1)\n","    * [4.2 Data Organization](#data_organization_4_2)\n","    * [4.3 Limitations](#limitations_4_3)\n","* [5. Process](#process_5)\n","    * [5.1 Installing Packages and Opening Libraries](#installing_packages_5_1)\n","    * [5.2 Importing the Datasets](#importing_datasets_5_2)\n","    * [5.3 Previewing Datasets](#previewing_datasets_5_3)\n","    * [5.4 Cleaning](#cleaning_5_4)\n","    * [5.5 Formatting](#formatting_5_5)\n","    * [5.6 Merging Datasets](#merging_datasets_5_6)\n","* [6. Analyze and Share](#analyze_share_6)\n","    * [6.1 Steps](#steps_6_1)\n","    * [6.2 Classifying Users Into Activity Levels](#classifying_users_6_2)\n","    * [6.3 Calories Burned by Activity Level](#calories_burned_activity_level_6_3)\n","    * [6.4 Calories Burned by Day](#calories_burned_day_6_4)\n","    * [6.5 Sleep](#sleep_6_5)\n","* [7. Act (Recommendations)](#act_7)\n","\n"]},{"cell_type":"markdown","id":"565d2e21","metadata":{"papermill":{"duration":0.009475,"end_time":"2022-11-02T13:56:55.502304","exception":false,"start_time":"2022-11-02T13:56:55.492829","status":"completed"},"tags":[]},"source":["# <span style=\"color:#005e6a\"> 1. Introduction </span> <a class=\"anchor\" id=\"introduction_1\"></a>\n","\n","This case study is the capstone project for the [Google Data Analytics Professional Certificate](https://www.coursera.org/professional-certificates/google-data-analytics?). In this case study, I will be analyzing the dataset provided as if I were working as a data analyst for Bellabeat."]},{"cell_type":"markdown","id":"741a7795","metadata":{"papermill":{"duration":0.009429,"end_time":"2022-11-02T13:56:55.521059","exception":false,"start_time":"2022-11-02T13:56:55.51163","status":"completed"},"tags":[]},"source":["# <span style=\"color:#005e6a\"> 2. About the Company </span> <a class=\"anchor\" id=\"about_company_2\"></a>\n","\n","[Bellabeat](https://bellabeat.com/) is a high-tech wellness company that manufactures health-focused smart products for women. They use an array of beautifully designed smart devices to collect data on activity, sleep, stress, and reproductive health in order to inform consumers about their own health and habits."]},{"cell_type":"markdown","id":"dffe0742","metadata":{"papermill":{"duration":0.009552,"end_time":"2022-11-02T13:56:55.540017","exception":false,"start_time":"2022-11-02T13:56:55.530465","status":"completed"},"tags":[]},"source":["# <span style=\"color:#005e6a\"> 3. Ask </span> <a class=\"anchor\" id=\"ask_3\"></a>\n","\n","\n","### 3.1 Business Task <a class=\"anchor\" id=\"business_task_3_1\"></a>\n","\n","Identify trends in how consumers use non-Bellabeat smart devices and \n","give recommendations for how these trends can inform Bellabeat's marketing strategy.\n","\n","### 3.2 Key Stakeholders <a class=\"anchor\" id=\"key_stakeholders_3_2\"></a>\n","\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer \n","* Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team \n","* Bellabeat Marketing Analytics team: Responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy\n","\n"]},{"cell_type":"markdown","id":"2779ffe9","metadata":{"papermill":{"duration":0.009543,"end_time":"2022-11-02T13:56:55.558986","exception":false,"start_time":"2022-11-02T13:56:55.549443","status":"completed"},"tags":[]},"source":["# <span style=\"color:#005e6a\"> 4. Prepare </span> <a class=\"anchor\" id=\"prepare_4\"></a>\n","\n","### 4.1 About the Data <a class=\"anchor\" id=\"about_data_4_1\"></a>\n","\n","The data source used is the [Fitbit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit?resource=download), which is licensed CC0: Public Domain, and made available through Möbius on Kaggle. The dataset was originally generated by respondents to a distributed survey via Amazon Mechanical Turk between April 12th, 2016 and May 12th, 2016.\n","\n","\n","### 4.2 Data Organization <a class=\"anchor\" id=\"data_organization_4_2\"></a>\n","\n","For this case study we will be using R so that we can explore, process, and visualize the datasets on a single platform. There are 18 CSV files available to us, however, several of the data frames will not be used for the analysis due to the fact that they are either subsets of larger, more complete data frames, or there was not enough data to draw meaningful conclusions. Therefore, we will only be using the following tables:\n","\n","| Table Name           | Type                | Description          |\n","| -------------------- | ------------------- | -------------------- |\n","| dailyActivity_merged | Microsoft Excel CSV | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories |\n","| hourlyCalories_merged | Microsoft Excel CSV | Hourly Calories burned over 31 days of 33 users |\n","| hourlyIntensities_merged | Microsoft Excel CSV | Hourly total and average intensity over 31 days of 33 users |\n","| hourlySteps_merged | Microsoft Excel CSV | Hourly Steps over 31 days of 33 users |\n","| sleepDay_merged | Microsoft Excel CSV| Daily sleep logs, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed |\n","\n","\n","### 4.3 Limitations <a class=\"anchor\" id=\"limitations_4_3\"></a>\n","\n","* We have no background information on any of the participants, and therefore have no way to confirm or deny if there was any sampling bias.\n","* Roughly a quarter of the participants didn’t record any sleep data. \n","* Only 8 participants recorded weight data, and more than half of the entries recorded were manual inputs.\n","* The original data is from 2016 -- 6 years ago -- and hasn't been updated for 2 years. Smart device usage, and technology in general, has likely changed at least to some degree since then.\n","* Participants didn't wear/use their FitBits for the entirety of the 31-day period, so some records are missing.\n","\n"]},{"cell_type":"markdown","id":"cc7d2d2b","metadata":{"papermill":{"duration":0.009643,"end_time":"2022-11-02T13:56:55.579364","exception":false,"start_time":"2022-11-02T13:56:55.569721","status":"completed"},"tags":[]},"source":["# <span style=\"color:#005e6a\"> 5. Process </span> <a class=\"anchor\" id=\"process_5\"></a>\n","\n","### 5.1 Installing Packages and Opening Libraries <a class=\"anchor\" id=\"installing_packages_5_1\"></a>\n","\n","We will be using the following packages for our analysis: \n","* tidyverse\n","* dplyr\n","* ggplot2\n","* janitor\n","* lubridate"]},{"cell_type":"code","execution_count":1,"id":"6d3ecf49","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:56:55.602103Z","iopub.status.busy":"2022-11-02T13:56:55.600228Z","iopub.status.idle":"2022-11-02T13:56:56.797697Z","shell.execute_reply":"2022-11-02T13:56:56.795207Z"},"papermill":{"duration":1.211724,"end_time":"2022-11-02T13:56:56.800777","