ed\n","* hourlyIntensities_merged\n","* hourlySteps_merged \n","* sleepDay_merged"]},{"cell_type":"code","execution_count":2,"id":"9a6acb68","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:56:56.864279Z","iopub.status.busy":"2022-11-02T13:56:56.842089Z","iopub.status.idle":"2022-11-02T13:56:57.009014Z","shell.execute_reply":"2022-11-02T13:56:57.007446Z"},"papermill":{"duration":0.180855,"end_time":"2022-11-02T13:56:57.011494","exception":false,"start_time":"2022-11-02T13:56:56.830639","status":"completed"},"tags":[]},"outputs":[],"source":["activity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\n","calories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlyCalories_merged.csv\")\n","intensities <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlyIntensities_merged.csv\")\n","steps <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlySteps_merged.csv\")\n","sleep <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")"]},{"cell_type":"markdown","id":"062c1b9e","metadata":{"papermill":{"duration":0.01023,"end_time":"2022-11-02T13:56:57.031912","exception":false,"start_time":"2022-11-02T13:56:57.021682","status":"completed"},"tags":[]},"source":["### 5.3 Previewing datasets <a class=\"anchor\" id=\"previewing_datasets_5_3\"></a>\n","\n","We want to preview the datasets with the head function to make sure everything imported correctly."]},{"cell_type":"code","execution_count":3,"id":"b59de560","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:56:57.056083Z","iopub.status.busy":"2022-11-02T13:56:57.054773Z","iopub.status.idle":"2022-11-02T13:56:57.129708Z","shell.execute_reply":"2022-11-02T13:56:57.127937Z"},"papermill":{"duration":0.089066,"end_time":"2022-11-02T13:56:57.132062","exception":false,"start_time":"2022-11-02T13:56:57.042996","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n",