9.756479","exception":false,"start_time":"2022-11-02T13:56:59.740679","status":"completed"},"tags":[]},"source":["### 6.2 Classifying Users into Activity Levels <a class=\"anchor\" id=\"classifying_users_6_2\"></a>\n","\n","Since we don't have any demographic information on these participants, we will classify them into different activity levels based on number of steps according to [this article](https://pubmed.ncbi.nlm.nih.gov/14715035/):\n","\n"," * Sedentary - Less than 5000 steps a day.\n"," * Low active - Between 5000 and 7499 steps a day.\n"," * Somewhat active - Between 7500 and 9999 steps a day.\n"," * Active - Between 10000 and 12500 steps a day.\n"," * Highly active - Greater than 12500 steps a day.\n"," \n","First, let's create a new table called `daily_average`. We will calculate the average daily steps per user from our `activity_sleep` table. We will also go ahead and calculate the average calories and total minutes asleep for future reference."]},{"cell_type":"code","execution_count":17,"id":"1a1214b9","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:56:59.790694Z","iopub.status.busy":"2022-11-02T13:56:59.789059Z","iopub.status.idle":"2022-11-02T13:56:59.817322Z","shell.execute_reply":"2022-11-02T13:56:59.815762Z"},"papermill":{"duration":0.04725,"end_time":"2022-11-02T13:56:59.819087","exception":false,"start_time":"2022-11-02T13:56:59.771837","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 4</caption>\n","<thead>\n","\t<tr><th scope=col>id</th><th scope=col>avg_daily_steps</th><th scope=col>avg_daily_calories</th><th scope=col>avg_daily_sleep</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td>12405.680</td><td>1872.280</td><td>360.2800</td></tr>\n","\t<tr><td>1644430081</td><td> 7967.750</td><td>2977.750</td><td>