ity_scatter))[,1]\n","\n","scatter <- ggplot(data=activity_scatter, aes(x=total_steps, y=calories, color = -pc)) + \n","  geom_point(shape = 16, size = 2.5, alpha = .5, show.legend = FALSE) + theme_bw() +\n","  geom_smooth(color = \"#036c5f\") + \n","  labs(title=\"Steps vs. Calories\", x= \"Steps\", y=\"Calories\", caption= 'Data Source: Fitabase Data 4.12.16-5.12.16') +\n","  theme(plot.title = element_text(hjust = 0.5, size = 18, face = \"bold\", color = \"#f8927e\")) +\n","  scale_color_gradient(low = \"#0091ff\", high = \"#f0650e\")\n","\n","scatter"]},{"cell_type":"markdown","id":"309beeef","metadata":{"papermill":{"duration":0.019719,"end_time":"2022-11-02T13:57:02.60488","exception":false,"start_time":"2022-11-02T13:57:02.585161","status":"completed"},"tags":[]},"source":["We can conclude that a person burns more calories with more steps taken, but not necessarily more than someone else."]},{"cell_type":"markdown","id":"869f94ec","metadata":{"papermill":{"duration":0.018333,"end_time":"2022-11-02T13:57:02.64193","exception":false,"start_time":"2022-11-02T13:57:02.623597","status":"completed"},"tags":[]},"source":["### 6.4 Calories Burned by Day <a class=\"anchor\" id=\"calories_burned_day_6_4\"></a>\n","\n","We want to see how many average calories were burned for each day of the week. For this, we'll create a new table from one of our original datasets, `activity`, and calculate the total average calories grouped by the day of the week rounded to the nearest whole number. "]},{"cell_type":"code","execution_count":24,"id":"1fb27ebd","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:57:02.68184Z","iopub.status.busy":"2022-11-02T13:57:02.680571Z","iopub.status.idle":"2022-11-02T13:57:02.718546Z","shell.execute_reply":"2022-11-02T13:57:02.716777Z"},"papermill":{"duration":0.060305,"end_time":"2022-11-02T13:57:02.720569","exception":false,"start_time":"2022-11-02T13:57:02.660264","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>day</th><th scope=col>avg_calories</th></tr>\n","\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Fri</td><td>2332</td></tr>\n","\t<tr><td>Mon</td><td>2324</td></tr>\n","\t<tr><td>Sat</td><td>2355</td></tr>\n","\t<tr><td>Sun</td><td>2263</td></tr>\n","\t<tr><td>Thu</td><td>2200</td></tr>\n","\t<tr><td>Tue</td><td>2356</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 6 × 2\n","\\begin{tabular}{ll}\n"," day & avg\\_calories\\\\\n"," <fct> & <dbl>\\\\\n","\\hline\n","\t Fri & 2332\\\\\n","\t Mon & 2324\\\\\n","\t Sat & 2355\\\\\n","\t Sun & 2263\\\\\n","\t Thu & 2200\\\\\n","\t Tue & 2356\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 6 × 2\n","\n","| day &lt;fct&gt; | avg_calories &lt;dbl&gt; |\n","|---|---|\n","| Fri | 2332 |\n","| Mon | 2324 |\n","| Sat | 2355 |\n","| Sun | 2263 |\n","| Thu | 2200 |\n","| Tue | 2356 |\n","\n"],"text/plain":["  day avg_calories\n","1 Fri 2332        \n","2 Mon 2324        \n","3 Sat 2355        \n","4 Sun 2263        \n","5 Thu 2200        \n","6 Tue 2356        "]},"metadata":{},"output_type":"display_data"}],"source":["cal_by_day <- activity %>% \n","  mutate(day = format(ymd(date), format = '%a')) %>%\n","  relocate(day, .before = date) %>% \n","  group_by(day) %>% \n","  summarize(avg_calories = mean(calories))\n","\n","\n","cal_by_day$avg_calories <- round(cal_by_day$avg_calories, digits = 0)\n","cal_by_day$day <- factor(cal_by_day$day, levels =  c('Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'))\n","\n","\n","head(cal_by_day)"]},{"cell_type":"code","execution_count":25,"id":"4fa4c330","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:57:02.761765Z","iopub.status.busy":"2022-11-02T13:57:02.760533Z","iopub.status.idle":"2022-11-02T13:57:02.973771Z","shell.execute_reply":"2022-11-02T13:57:02.971456Z"},"papermill":{"duration":0.2371