output_type":"display_data"}],"source":["daily_sleep <- activity_sleep %>% \n","  group_by(day) %>% \n","  summarize(avg_min_asleep = mean(total_minutes_asleep), \n","            avg_min_bed = mean(total_time_in_bed),\n","            hours_asleep = avg_min_asleep/60,\n","            hours_bed = avg_min_bed/60,\n","            time_awake_min = avg_min_bed - avg_min_asleep)\n","\n","daily_sleep$hours_asleep <- round(daily_sleep$hours_asleep, digits = 2)\n","daily_sleep$hours_bed <- round(daily_sleep$hours_bed, digits = 2)\n","daily_sleep$time_awake_min <- round(daily_sleep$time_awake_min, digits = 0)\n","daily_sleep$day <- factor(daily_sleep$day, levels = c('Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'))\n","\n","head(daily_sleep)"]},{"cell_type":"code","execution_count":27,"id":"401b1865","metadata":{"execution":{"iopub.execute_input":"2022-11-02T13:57:03.178464Z","iopub.status.busy":"2022-11-02T13:57:03.177171Z","iopub.status.idle":"2022-11-02T13:57:03.665198Z","shell.execute_reply":"2022-11-02T13:57:03.663957Z"},"papermill":{"duration":0.511274,"end_time":"2022-11-02T13:57:03.667156","exception":false,"start_time":"2022-11-02T13:57:03.155882","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUZf4H8O8zM7ubTU9IqEnoJRCaEKp4Iih6yCF2xXKWu8N23t1PwTv11PPk\nRD08u56evTcEFVFEetHQS4DQAwmkh7RtM/P8/tjN7ibZlk2yZfJ5v3i9mJ15ZuY7z05mv/M8\nUxjnnAAAAAAg+gnhDgAAAAAA2gcSOwAAAACNQGIHAAAAoBFI7AAAAAA0AokdAAAAgEYgsQMA\nAADQCCR2AAAAABqBxA4AAABAI6RwBwDgAc97zbql2PVZ190w747whaNl1pcf44pqH2bdb9Bf\nNdBjMfX752wFlc6PhrsfJcZCEV/Uk9WtK+WDB/jZWuJEok649G5dRkIAM6r8ZL5yuICXFvHa\nem61kKBnBiNL6ca69xGGjBSSYz3OZnnpUVIdj50XbnhAl2Jsv20JA/7Lq9afT3udzETSx7DE\nNKHnAGHEOCE5pkODUT9+ylZW73maIJIuhsWnsG5Z4qAxQmZah0YC4AMSO4hE8s6yJp9tZ+RK\nk5Qa3T9R0AmpP71m21fq9lkhVfU/W+UB2w/L1GY5hGLmNjOvq6KTB5S874VBU6QLzmc6sZ0j\nji5cIUs9L6tXyk4ou9eLE6+Wxng+M+lwqkKWem6p5xWn1PxNrNdI3aWzmb5zfzsQJuiKhchT\nt0U125qNUzcWhiUWgOApVbb8Mv/Fmq