 = 0.5, size = 18, face = \"bold\", color = \"#f8927e\"))\n","\n","\n","\n","daily_sleep_bar\n","\n","fall_asleep_bar"]},{"cell_type":"markdown","id":"2570af09","metadata":{"papermill":{"duration":0.020582,"end_time":"2022-11-02T13:57:03.708459","exception":false,"start_time":"2022-11-02T13:57:03.687877","status":"completed"},"tags":[]},"source":["[According to the CDC](https://www.cdc.gov/sleep/about_sleep/how_much_sleep.html), 7 or more hours of sleep per night is recommended for adults. Wednesday and Sunday were the only two days where this goal was reached. Although users got the most amount of sleep on Sunday, it took them longer to fall asleep that day than any other day of the week."]},{"cell_type":"markdown","id":"20699dc4","metadata":{"papermill":{"duration":0.020679,"end_time":"2022-11-02T13:57:03.750153","exception":false,"start_time":"2022-11-02T13:57:03.729474","status":"completed"},"tags":[]},"source":["# <span style=\"color:#005e6a\"> 7. Act (Recommendations) </span> <a class=\"anchor\" id=\"act_7\"></a>\n","\n","### To reiterate some key conclusions:\n","\n","* Users did not get enough steps in per day.\n","* More activity increases calorie expenditure.\n","* Users need more sleep overall.\n","\n","### Here are some recommendations:\n","\n","#### 1. Activity\n","\n","**Encourage users to move more.** People often get busy, especially during the workday, and don't even realize how long it's been since they have moved around. A notification to take more steps during long periods of sedentary behavior can help Bellabeat wearers improve their daily activity and overall health. Users can also benefit from a goal of [30 minutes of activity per day](https://www.betterhealth.vic.gov.au/health/healthyliving/walking-for-good-health), in addition to a step count goal.\n","\n","#### 2. Sleep\n","\n","**Promote comfortability with Bellabeat fitness trackers to encourage users to wear them while sleeping.** [Sleep plays a vital roll in our overall health](https://www.nhlbi.nih.gov/health/sleep/why-sleep-important), and yet its importance is often overlooked. If users had good insight into their sleeping patterns, they would realize that they are not getting enough sleep, which could affect their [activity level](https://www.everydayhealth.com/fitness/intimate-relationship-between-fitness-sleep/). \n","\n","Based on the data, the users would have gotten enough sleep if they had actually fallen asleep immediately after getting in bed. However, it took users an average of 40 minutes to fall asleep. If users were **encouraged to go to bed at a certain time** based on their own unique sleeping patterns, then this could help Bellabeat consumers get the recommended hours of sleep, or more.\n","\n","Another thing that would help consumers receive more sleep data is to **reduce the amount of time it takes to charge the battery.** Right now it takes the Ivy up to [3 hours](https://support.bellabeat.com/hc/en-us/articles/360020620639-Charging-the-Ivy) to fully charge. With long charging times, people are more likely to charge their devices when not in use; i.e., during sleep. Having a shorter charging time will encourage Bellabeat consumers to charge their fitness trackers during shorter periods of non-use so that they can wear their devices while sleeping, which can then track their sleeping patterns.\n","\n","#### 3. Weight\n","\n","Managing a healthy weight [contributes to good health](https://www.cdc.gov/healthyweight/index.html). Because only 8 out of the 33 participants tracked their weight, there was not enough data to make any conclusions based on this subject matter. Which is why it is important to **promote weight positivity** so that consumers are more likely to enter their weight info, and in return can receive valuable insights whether they want to lose, gain, or maintain their weight.\n","\n","#### 4. Nutrition\n","\n","[Nutrition is a critical part of health and wellness](https://www.who.int/health-topics/nutrition). Most fitness trackers are designed to focus mainly on activity with no regards toward nutrition. But the fact is that no amount of activity is going to counteract or \"undo\" a [poor diet](https://www.healthline.com/health-news/you-cant-exercise-your-way-out-of-an-unhealthy-diet). Adding a feature for users to log meals and receive feedback, as well as receive food recommendations can help give Bellabeat an advantage over its competitors.\n","\n","\n","\n","\n","\n"]},{"cell_type":"markdown","id":"da10d3f2","metadata":{"papermill":{"duration":0.020856,"end_time":"2022-11-02T13:57:03.791657","exception":false,"start_time":"2022-11-02T13:57:03.770801","status":"completed"},"tags":[]},"source":["### <span style=\"color:#f8927e\"> Thank you for reading! </span>"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":11.874603,"end_time":"2022-11-02T13:57:03.93111","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-02T13:56:52.056507","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}